body:
@qraleq Can you share the ONNX file to help debug this layout optimizer problem? Thanks!

Does the model run with the optimizations turned down? Try ORT_ENABLE_EXTENDED to disable the layout optimizer.

https://github.com/microsoft/onnxruntime/blob/master/docs/ONNX_Runtime_Graph_Optimizations.md

@tracysh What's the best way to share the ONNX file with you? 

I did try ORT_ENABLE_EXTENDED, it results in a different error:

> Fail: [ONNXRuntimeError] : 1 : FAIL : Non-zero status code returned while running FusedConv node. Name:'fused Conv__1363_1' Status Message: Input channels C is not equal to kernel channels * group. C: 34 kernel channels: 1 group: 32
